    if (io_stall | ~io_prev_valid) begin
    end
    else begin
      regs_MemOut <= io_prev_bits_MemOut;
      regs_ALUOut <= io_prev_bits_ALUOut;
      regs_wbSel <= io_prev_bits_wbSel;
      regs_wbDst <= io_prev_bits_wbDst;
